const WebFormList = ({ webFields, removeFromList }) => {
  const listFields = webFields;
  const list = listFields
    .sort((a, b) => b.order > a.order ? 1 : -1)
    .map(
      ({
        _id,
        fieldName,
        fieldInForm,
        fieldFormVisible,
        fieldOptions,
        fieldType
      }) =>
        fieldInForm ? (
          <li key={_id}>
            {fieldName}
            {fieldFormVisible
              ? ` -> visible in form`
              : fieldType === "select"
              ? ` -> hidden in form with ${fieldOptions.map(e =>
                  e.preselected ? e.value : null
                )} as preselected!`
              : null}

            <button id={fieldName} onClick={removeFromList}>
              X
            </button>
          </li>
        ) : (
          []
        )
    );

  return <ul>{list}</ul>;
};

export default WebFormList;
